(()=>{let e=new MutationObserver((t=>{for(let o of t)for(let t of o.addedNodes)if(t.matches&&t.matches(".n-adjust-height")){t.style.removeProperty("--adjust-height");let o=getComputedStyle(t),s=parseFloat(o.lineHeight),r=s-parseFloat(o.height)%s;r!==s&&t.style.setProperty("--adjust-height",r),e.disconnect()}}));e.observe(document.documentElement,{childList:!0,subtree:!0})})();